import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import imgPath from "./borna-bevanda-w12NAMymqnk-unsplash.jpg";
const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1
  },
  menuButton: {
    marginRight: "24px"
  },
  title: {
    flexGrow: 1,
    marginLeft: "24px"
  },
  test: {
    marginLeft: "24px",
    marginRight: "24px"
  }
}));

function Carousel() {
  const classes = useStyles();
  return (
    <div className={classes.test}>
      <img src={imgPath} alt="img" width="960px" height="240px"></img>
    </div>
  );
}

export default Carousel;
